/* Update UDF records */

WITH MatchedBuildingsRooms AS -- 1652 rows
(
    SELECT *
    FROM
        @CriticalRooms AS A LEFT OUTER JOIN
        ae_b_loc_d AS B ON A.Building = B.bldg AND A.Room = B.location_code
    WHERE
        B.bldg IS NOT NULL AND
        B.multitenant_id = 1 AND
        B.region_code = 'TX'
),
LocationCodeJoinExistingUDF AS -- 1652 rows
(
    SELECT A.multitenant_id, A.region_code, A.fac_id, A.bldg, A.location_code, A.loc_id
    FROM 
        MatchedBuildingsRooms AS A LEFT OUTER JOIN
        ae_b_loc_d_udf AS B ON A.multitenant_id = B.multitenant_id AND A.region_code = B.region_code AND A.fac_id = B.fac_id AND A.bldg = B.bldg AND A.loc_id = B.loc_id
        WHERE b.bldg IS NOT NULL
)
UPDATE ae_b_loc_d_udf
SET 
